import React from 'react';
import './Nav-item.styles.scss'
import { withRouter } from 'react-router-dom';

const NavItem = ({item, path}) =>{
    return (
        <div className = 'nav-item' style={{lineHeight:'50px', cursor:'pointer'}} onClick = {()=>this.props.history.push(`/${path}`)}>
            <span>{item}</span>
        </div>
    )
}

export default withRouter(NavItem)
